export default function Node(
	key = undefined,
	down = null,
	left = null,
	right = null,
	up = null,
) {
	this.key = key;
	this.right = right;
	this.down = down;
	this.left = left;
	this.up = up;
}

import assert from 'assert';
import Node from './Node.js';
import keys from './keys.js';
import iter from './iter.js';
import downMost from './downMost.js';
import searchTopMost from './searchTopMost.js';
import bottomMostPredecessor from './bottomMostPredecessor.js';
import deleteFromTopMost from './deleteFromTopMost.js';
import insertFromBottomMostPredecessor from './insertFromBottomMostPredecessor.js';
import makeQuasiRandom from './makeQuasiRandom.js';
import makeBottomLevel from './makeBottomLevel.js';

/**
 * @param {Number} p Promotion probability in (0,1).
 * @param {Function} compare
 * @param {Node} head
 */
export default function SkipList(p, compare, head = new Node()) {
	this.head = head; // Sentinel node
	this.p = p;
	this.compare = compare;
}

SkipList.prototype.add = function (key) {
	const node = bottomMostPredecessor(this.compare, this.head, key);
	const pred = insertFromBottomMostPredecessor(this.p, node, key);
	if (pred.left === null && pred.up === null) this.head = pred;
};

SkipList.prototype.get = function (key) {
	const node = searchTopMost(this.compare, this.head, key);
	return node === null ? null : node.key;
};

SkipList.prototype.has = function (key) {
	return searchTopMost(this.compare, this.head, key) !== null;
};

SkipList.prototype.remove = function (key) {
	const node = searchTopMost(this.compare, this.head, key);
	if (node === null) return false;

	deleteFromTopMost(node);
	return true;
};

SkipList.prototype._predecessor = function (key) {
	return bottomMostPredecessor(this.compare, this.head, key);
};

SkipList.prototype.levelOne = function () {
	return downMost(this.head);
};

SkipList.prototype.levels = function () {
	assert(this.head !== null);
	let k = 0;
	let current = this.head;
	do {
		++k;
		current = current.down;
	} while (current !== null);

	return k;
};

SkipList.prototype.keys = function () {
	const level = this.levelOne();
	return keys(level);
};

SkipList.prototype.values = function () {
	return this.keys();
};

SkipList.prototype[Symbol.iterator] = function () {
	return this.keys();
};

SkipList.prototype.range = function* (left, right) {
	const pred = this._predecessor(left);
	for (const node of iter(pred)) {
		if (this.compare(node.key, right) >= 0) break;
		yield node.key;
	}
};

SkipList.from = (compare, iterable, p = 1 / 2) => {
	if (p === 1 / 2) {
		const bottomLevelHead = makeBottomLevel(compare, iterable);
		const head = makeQuasiRandom(p, bottomLevelHead);
		return new SkipList(p, compare, head);
	}

	const list = new SkipList(p, compare);
	for (const key of iterable) list.add(key);
	return list;
};

import assert from 'assert';

const bottomMostPredecessor = (compare, node, key) => {
	// eslint-disable-next-line no-constant-condition
	while (true) {
		assert(node !== null);
		// Predecessor search on current level
		while (node.right !== null && compare(key, node.right.key) > 0)
			node = node.right;

		// Continue on bottom level or abandon
		if (node.down === null) return node;
		node = node.down;
	}
};

export default bottomMostPredecessor;

import {enumerate} from '@iterable-iterator/zip';
import {count} from '@iterable-iterator/cardinality';

import iter from './iter.js';
import iterDown from './iterDown.js';

export default function* debug(skiplist) {
	for (const [k, sentinel] of enumerate(iterDown(skiplist.head))) {
		yield [k, count(iter(sentinel))];
	}
}

import assert from 'assert';

const deleteFromTopMost = (node) => {
	assert(node !== null);
	assert(node.up === null); // Node is from top-most level
	do {
		assert(node.left !== null); // Node is not sentinel
		node.left.right = node.right;
		if (node.right !== null) node.right.left = node.left;
		node = node.down;
	} while (node !== null);
};

export default deleteFromTopMost;

import assert from 'assert';

const downMost = (node) => {
	assert(node !== null);
	while (node.down !== null) node = node.down;
	return node;
};

export default downMost;

// See https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/random
// "The Math.random() function returns a floating-point, pseudo-random number in
// the range 0 to less than 1 (inclusive of 0, but not 1)"
const heads = (bias = 1 / 2) => Math.random() < bias;

export default heads;

export {default as SkipList} from './SkipList.js';

export {default as keys} from './keys.js';
export {default as makeDeterministic} from './makeDeterministic.js';
export {default as makeQuasiRandom} from './makeQuasiRandom.js';
export {default as node} from './node.js';
export {default as predecessorOnPreviousLevel} from './predecessorOnPreviousLevel.js';
export {default as searchTopMost} from './searchTopMost.js';

export {default as Node} from './Node.js';
export {default as bottomMostPredecessor} from './bottomMostPredecessor.js';
export {default as debug} from './debug.js';
export {default as downMost} from './downMost.js';
export {default as deleteFromTopMost} from './deleteFromTopMost.js';
export {default as insertFromBottomMostPredecessor} from './insertFromBottomMostPredecessor.js';
export {default as heads} from './heads.js';
export {default as iterDown} from './iterDown.js';
export {default as iter} from './iter.js';
export {default as makeBottomLevel} from './makeBottomLevel.js';

import assert from 'assert';

import node from './node.js';
import heads from './heads.js';
import predecessorOnPreviousLevel from './predecessorOnPreviousLevel.js';

const insertFromBottomMostPredecessor = (p, pred, key) => {
	assert(pred !== null);
	let newNode = node(key, null, pred, pred.right);
	while (heads(p)) {
		pred = predecessorOnPreviousLevel(pred);
		assert(pred !== null);
		newNode = node(key, newNode, pred, pred.right);
	}

	return pred;
};

export default insertFromBottomMostPredecessor;

import assert from 'assert';

export default function* iter(head) {
	assert(head !== null);
	while (head.right !== null) {
		head = head.right;
		yield head;
	}
}

export default function* iterDown(head) {
	while (head !== null) {
		yield head;
		head = head.down;
	}
}

import iter from './iter.js';

export default function* keys(level) {
	for (const node of iter(level)) yield node.key;
}

import Node from './Node.js';

const makeBottomLevel = (compare, iterable) => {
	const sorted = [...iterable].sort(compare);
	const bottomLevelHead = new Node();
	let current = bottomLevelHead;
	for (const key of sorted) {
		current = new Node(key, null, current);
		current.left.right = current;
	}

	return bottomLevelHead;
};

export default makeBottomLevel;

import assert from 'assert';
import Node from './Node.js';

/**
 * Make a balanced Skip-list with p = 1/2.
 */
const makeDeterministic = (p, head) => {
	assert(p === 1 / 2);

	// Together, the if and while conditions guarantee that `makeQuasiRandom`
	// does not do anything if the number of elements is <= 1
	// TODO Could use some other constant?
	if (head.right === null) return head;

	while (head.right.right !== null) {
		const newHead = new Node(head.key, head);

		let current = head;
		let next = newHead;
		while (current.right !== null) {
			current = current.right;
			if (current.right === null) break; // Skip odd indexed nodes
			current = current.right;
			next = new Node(current.key, current, next);
			next.left.right = next;
			current.up = next;
		}

		head.up = newHead;
		head = newHead;
		assert(head.right !== null);
	}

	return head;
};

export default makeDeterministic;

import assert from 'assert';
import Node from './Node.js';
import heads from './heads.js';

/**
 * Make a balanced Skip-list with p = 1/2 but randomizing the choice of
 * promoted nodes at each level.
 */
const makeQuasiRandom = (p, head) => {
	assert(p === 1 / 2);

	// Together, the if and while conditions guarantee that `makeQuasiRandom`
	// does not do anything if the number of elements is <= 1
	// TODO Could use some other constant?
	if (head.right === null) return head;

	while (head.right.right !== null) {
		const newHead = new Node(head.key, head);

		let current = head;
		let next = newHead;
		while (current.right !== null) {
			current = current.right;
			let previousPromoted = false;

			if (heads(1 / 2)) {
				previousPromoted = true;
				next = new Node(current.key, current, next);
				next.left.right = next;
				current.up = next;
				// TODO can reduce branching by getting rid of `previousPromoted`
			}

			if (current.right === null) break;
			current = current.right;
			if (!previousPromoted) {
				next = new Node(current.key, current, next);
				next.left.right = next;
				current.up = next;
			}
		}

		head.up = newHead;
		head = newHead;
		assert(head.right !== null);
	}

	return head;
};

export default makeQuasiRandom;

import Node from './Node.js';

const node = (
	key = undefined,
	down = null,
	left = null,
	right = null,
	up = null,
) => {
	const newNode = new Node(key, down, left, right, up);
	if (down !== null) down.up = newNode;
	if (left !== null) left.right = newNode;
	if (right !== null) right.left = newNode;
	if (up !== null) up.down = newNode;
	return newNode;
};

export default node;

import assert from 'assert';

import Node from './Node.js';

const predecessorOnPreviousLevel = (node) => {
	assert(node !== null);

	while (node.up === null) {
		if (node.left === null) {
			const newNode = new Node(undefined, node); // Top-most left-most sentinel
			node.up = newNode;
			return newNode;
		}

		node = node.left;
	}

	return node.up;
};

export default predecessorOnPreviousLevel;

import assert from 'assert';

const searchTopMost = (compare, node, key) => {
	// eslint-disable-next-line no-constant-condition
	while (true) {
		assert(node !== null);
		if (node.right === null) {
			if (node.down === null) {
				return null;
			}

			node = node.down;
		} else {
			const d = compare(key, node.right.key);
			if (d === 0) {
				assert(node.right.up === null);
				return node.right;
			}

			if (d > 0) node = node.right;
			else {
				if (node.down === null) {
					return null;
				}

				node = node.down;
			}
		}
	}
};

export default searchTopMost;

